import './App.css';
import Search from './components/Search.js'
import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      video_info: [],
      select_video_info: null
    };
  }
  render() {
    return (
      <div className="App">
        <Search onSeach={this.onSeach} />
      </div>
    );
  }
}

export default App;
